detail:
Herstellen von Beschichtungen und Abdichtungen aller Art für Auffangwannen aus Beton, Stahl, Kunststoffen, die verhindern, dass wassergefährdende Flüssigkeiten ins Grundwasser gelangen.

Erstellen von Produktionsanlagen und Entsorgungsanlagen im vorstehend genannten Tätigkeitsfeld in kompletter Ausführung.

Bodensanierungsarbeiten im Betriebsbodenbereich, Parkhausbereich und Brückenbereich;

PE-HD-Folienabdichtungen für Deponien, Wasserbecken und Chemielager;

WHG / MPA-Beschichtungen mit Prüfzeichen für wassergefährdende Medien;

Säurebauisolierungen.

Ihr Partner in Sachen Kunststoff. Wir besitzen die Fachbetriebsanerkennung nach § 19L des Wasserhaushaltsgesetzes (WHG) und fertigen nach den aktuellen DVS-Richtlinien. Verwendet werden die thermoplastischen Kunststoffe: PVC, PVC-C, PP, PE, PVDF

Absperrklappen, Kunststoff; Drosselklappen, Kunststoff; Schüttgutschieber, Kunststoff; Gitterroste, Kunststoff;

Verschraubungen, Kunststoff; Bodeneinläufe, Kunststoff; Behälter, Kunststoff, säurebeständig; Spritzteile und Tiefziehteile, Kunststoff, nach Kundenwunsch; Demister, Kunststoff, für Flüssigkeitsabscheider; Auffangwannen, Kunststoff, für wassergefährdende Stoffe; Kolonneneinbauten; Schmutzfänger, Kunststoff; Schrägsitzventile; Säurearmaturen; Rückschlagkappen, Kunststoff; Abluftwäscher

Rohrschlangensysteme, zylindrisch, konisch, spiralförmig, Rohrschlangen für Synthesegaskühlung, Dampfkesselkomponenten, Wärmeträgerölanlagen, Flachschlangen, Rohrbogen mit Sonderradien bis Rohr-Ø 406,4 mm, Ringleitungen, Biegungen nach Isometrien für Kesselwände; Zulassungen: HPO, WO/TRD 100, GL Bureau Veritas, DGRL, Stamp Holder for ASME SEC. VIII Div.1 and SEC I U + S, China Manufacturers Lisence for pressure vessel level A2 and for organic fluid boilers;

Biegungen für den Kesselbau

Economiser, Wärmeaustauscher, Speisewasservorwärmer, Kraftwerksrohrleitungen, Industrierohrleitungen
